import React,{useState} from 'react';

function Example (){
  const[fruit,setfruit] = useState('apple');
  return (

  <div>
    <h2>Fruit :{fruit}</h2>
   <button onClick={()=> setfruit("apple")}>Apple</button>
   <button onClick={(setfruit())}>Mongo</button>
   <button>banana</button>


  </div>
  )
}
